                oracion += cadenas[i].substring(0, 1).toUpperCase() + cadenas[i].substring(1).toLowerCase() + " ";
            }
            oracion += cadenas[cadenas.length - 1].substring(0, 1).toUpperCase() + cadenas[cadenas.length - 1].substring(1).toLowerCase();
